@andreadegiovine 

I agree with @chmtc94, as I'm also unclear how the following should be implemented.
> Add a new method (e.g., "get_energy_map") for the iterations that returns the correct maps, and use it for "get_value_from_map" and "get_updated_at_from_map" when the first key is "energies."

How would the new function (e.g., "get_energy_map") select and return the correct map, e.g., for the autonomy sensor?
Can you please explain your approach?

```
    "autonomy" : {
        "icon" : "mdi:map-marker-distance",
        "unit_of_measurement" : UnitOfLength.KILOMETERS,
        "device_class": SensorDeviceClass.DISTANCE,
        "state_class": SensorStateClass.MEASUREMENT,
        "value_map" : ["energies", 0, "autonomy"],
        "updated_at_map" : ["energies", 0, "createdAt"]
    },
.....
    "fuel_autonomy" : {
        "icon" : "mdi:map-marker-distance",
        "unit_of_measurement" : UnitOfLength.KILOMETERS,
        "device_class": SensorDeviceClass.DISTANCE,
        "state_class": SensorStateClass.MEASUREMENT,
        "value_map" : ["energies", 0, "autonomy"],
        "updated_at_map" : ["energies", 0, "createdAt"],
        "engine": [VEHICLE_TYPE_THERMIC, VEHICLE_TYPE_HYBRID]
    },
```
In cases where Stellantis provides the following data:
```
    "energies": [
        {
            "createdAt": "2023-12-28T17:21:11Z",
            "type": "Fuel",
            "subType": "FossilEnergy",
            "autonomy": 0,
            "extension": {
                "fuel": {
                    "consumptions": {
                        "total": 0.0
                    }
                }
            }
        },
        {
            "createdAt": "2025-06-30T15:57:54Z",
            "type": "Electric",
            "subType": "ElectricEnergy",
            "level": 60.0,
            "autonomy": 164,
            "extension": {
                "electric": {
                    "battery": {
                        "load": {
                            "createdAt": "2025-06-30T15:57:54Z",
                            "capacity": 36672,
                            "residual": 20512
                        }
                    },
                    "charging": {
                        "plugged": true,
                        "status": "InProgress",
                        "remainingTime": "PT8H40M",
                        "chargingRate": 14,
                        "chargingMode": "Slow",
                        "nextDelayedTime": "PT2H",
                        "schedule": []
                    }
                }
            }
        }
    ],
```

The solution suggested by @chmtc94 is to use the "type" element to look up the correct map using a dictionary ({"type":"Fuel"} for fuel sensors and {"type":"Electric"} for battery sensors). This seems to be an elegant and easy way.
Where do you see issues with such solution?

